    """
    arr = [str(i) for i in arr]
    if not len(arr):
        return 0
    if len(arr) == 1:
        return 0
    if len(arr) == 2:
        if arr[0] == arr[1]:
            return 0
        else:
            return 1
    for i in range(1, len(arr)):
        arr[i] = arr[i] + arr[i - 1]
    for i in range(1, len(arr)):
        arr[i] = arr[i] + arr[i - 1]
    for i in range(len(arr) - 1, 0, -1):
        if arr[i] == arr[i - 1]:
            return 0
        else:
            return 1

